import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './App.css'; // Import your CSS file

function App() {
  return (
    <div className="App">
      {/* Header component */}
      <Navbar bg="dark" variant="dark" expand="lg" className="site-navbar site-navbar-target">
        <Container>
          <Navbar.Brand href="#home">Stackpackers</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">HOME</Nav.Link>
              <Nav.Link href="#about">ABOUT</Nav.Link>
              <Nav.Link href="#music">MUSIC</Nav.Link>
              <Nav.Link href="#contact">CONTACT</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Main content */}
      <main>
        {/* Home component */}
        <div id="Home" className="tabcontent">
          {/* Home content */}
        </div>

        {/* About component */}
        <div id="About" className="tabcontent">
          {/* About content */}
        </div>

        {/* Music component */}
        <div id="Music" className="tabcontent">
          {/* Music content */}
        </div>

        {/* Contact component */}
        <div id="Contact" className="tabcontent">
          {/* Contact content */}
        </div>
      </main>

      {/* Footer component */}
      <footer>
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
